<!-- 用来筛选地图，可以选择市区、作物种类等功能 -->

<script>
export default {
  name: "MapSelecting",
  data() {
    return {
      // http://xzqh.mca.gov.cn/defaultQuery?shengji=%BA%A3%C4%CF%CA%A1%A3%A8%C7%ED%A3%A9&diji=-1&xianji=-1
      cities: [
        {label: '海口市', value: 'haikou', code: 460100, coordinate: [19.938405, 110.269345]},
        {label: '三亚市', value: 'sanya', code: 460200, coordinate: [18.395579, 109.259794]},
      ],
      form: {
        city: '',
      }
    }
  },
  methods: {
    jumpToCity() {
      const coordinate = this.cities.find(city => city.code === this.form.city).coordinate;
      if (!coordinate) {
        return;
      }
      this.$shared.map.setCenter(new TMap.LatLng(...coordinate));
      this.$shared.map.setZoom(10)
      this.showPoint()
    },
    showPoint() {
      const points = [{ //点标注数据数组
        "id": "demo",
        "styleId": "marker",
        "position": new TMap.LatLng(18.379112, 109.156309),
        "properties": {
          "picture": "data:image/jpeg;base64,"
        }
      }, { //点标注数据数组
        "id": "demo",
        "styleId": "marker",
        "position": new TMap.LatLng(18.336289, 109.334533),
        "properties": {
          "picture": "data:image/jpeg;base64,"
        }
      }, { //点标注数据数组
        "id": "demo",
        "styleId": "marker",
        "position": new TMap.LatLng(18.364839, 109.263243),
        "properties": {
          "picture": "data:image/jpeg;base64,"
        }
      }]
      this.$shared.marker.setGeometries(points)
    }
  }
}
</script>

<template>
  <div>
    <el-select v-model="form.city" placeholder="请选择市县" @change="jumpToCity">
      <el-option v-for="city in cities"
                 :key="city.code" :label="city.label" :value="city.code">
      </el-option>
    </el-select>
  </div>
</template>

